import Navbar from "../Navbar"

export const NavbarContainer = styled.div`
display: flex;
justify-content: space-between;
height: 80px;
z-index: 1;
width: 100%;
padding: 0 24px;
max-width: 1100px;
`;
export const COLUMNS = [
    {
        Header: 'Filter By',
        accessor: 'internship_name',
    },
    {
        Header: 'Name of scholarship',
        accessor: 'internship_url',
    },
   
    
]
